import React, { Component } from 'react'; 
import Navigation from './Components/Navbar';
import Home from './Components/Home';
import './App.css';
import Cart from './Components/Cart'

class App extends Component {
  render() {  
    return (
      <div className="App">
          <Navigation />
          <Home />
          <Cart />

      </div>
    );
  }
}

export default App;
